//store.steampowered.com/search/?developer=Joongwon%20Entertainment&snr=1_5_9__400",publisherlink:"https://store.steampowered.com/search/?publisher=Joongwon%20Games&snr=1_5_9__422",game_description:'<H2>About This Game</H2><IMG src="https://steamcdn-a.akamaihd.net/steam/apps/956580/extras/gif_002_1.gif?t=1559189655"><BR><STRONG>About This Game</STRONG><BR>Nine Dragons, selected by 7M global players has returned with a brand new type of gameplay and dynamic Martial-Art action.<BR><BR>From the Gado island, the mysterious place that has a rumor of nine dragon\u2019s legacy, overcome the adversity which comes from deadly enemies and hopeless environment to prove yourself the worthy one to be a master of nine dragon\u2019s world.<BR><BR><BR><STRONG>[Gado Island]</STRONG><BR>Gado island became a bloody battleground by 50 unknown mercenaries who try to obtain the nine dragon\u2019s legacy because of the rumor that tells whoever obtains the legacy, will gain enough power to rule the nine dragon\u2019s world.<BR>As one of the mercenaries, without any allies, you must fight through the battleground to find \u201cDragon\u2019s Jade\u201d which is the key to enter the place that nine dragon\u2019s legacy is hidden and reveal the ancient mystery.<BR><BR><IMG src="https://steamcdn-a.akamaihd.net/steam/apps/956580/extras/gif_004_1.gif?t=1559189655"><BR><STRONG>[Prepare for the battle]</STRONG><BR>You will be dragged to the island with nothing to help you fight or survive and therefore, must search for supplies and farm yourself before you face another mercenary with nothing in your hand.<BR>Even a single dumpling could cause a serious difference during the combat. To maintain survivability and chance to win the battle, we recommend checking every item that you find and make a way to use it in your own way. Like just said, every item has their own way to support your gameplay.<BR>Sometimes, you will be able to find a hidden item from the unexpected place or a mysterious NPC and of course, it will be a game changer once you find it.<BR>There are several weapon types and various socket items that you can insert to the weapon. Experience every weapon type you can find, build your own combat style and choose them strategically to cope with all the situations you may face during the gameplay.<BR><BR><BR><IMG src="https://steamcdn-a.akamaihd.net/steam/apps/956580/extras/9dak_001.gif?t=1559189655"><BR><STRONG>[History will only remember the survivor]</STRONG><BR>Remember, it is not honor that keeps you alive on the battleground and wins the battle, and the only one who can discuss the honor is the one who survived from the battle.<BR>Sometimes you\'ll learn to turn your back on your enemies and run away promising the next opportunity, and when the opportunity comes, you\'ll learn how to use all the things that are given for victory, even if it\u2019s way far from the honor.<BR><BR><STRONG>[The Dragon\u2019s Jade]</STRONG><BR>There are nine ruins that use to be a clan house for each nine clans of this world in Gado island and three of those ruins have the dragon\u2019s Jade which is the key to the chamber that nine dragon\u2019s legacy is hidden.<BR>The key will show the location of the chamber in your map by a mark, and once the key gets out from the ruins, it will show the chamber\u2019s location to every people after a certain time after it.<BR>Some of you will try to visit the ruins while some of you will search for the one who already has key. It\u2019s obvious in this world when you kill someone, you take everything that they had.<BR><BR><STRONG>[It is only the beginning]</STRONG><BR>Do not be disappointed when you hear someone already got the key and revealed the legend of nine dragon\u2019s legacy. We\u2019re going to provide another thrilling adventure to you in an early day.\n<H2>Mature Content Description</H2><P>The developers describe the content like this:</P><P><I>This game may contain content not appropriate for all ages, or may not be appropriate for viewing at work: Frequent violence or Gore, General Mature Content </I></P>',system_requirements:'<H2>System Requirements</H2><DIV class=sysreq_contents><DIV class="game_area_sys_req sysreq_content active" data-os="win"><DIV class=game_area_sys_req_leftCol><UL><STRONG>Minimum:</STRONG><BR><UL class=bb_ul><LI>Requires a 64-bit processor and operating system<BR><LI><STRONG>OS:</STRONG> Windows 7 64 bit<BR><LI><STRONG>Processor:</STRONG> Intel i3 2.4Ghz<BR><LI><STRONG>Memory:</STRONG> 8 GB RAM<BR><LI><STRONG>Graphics:</STRONG> Geforce GTX 650<BR><LI><STRONG>DirectX:</STRONG> Version 11<BR><LI><STRONG>Network:</STRONG> Broadband Internet connection<BR><LI><STRONG>Storage:</STRONG> 5 GB available space</LI></UL></UL></DIV><DIV class=game_area_sys_req_rightCol><UL><STRONG>Recommended:</STRONG><BR><UL class=bb_ul><LI>Requires a 64-bit processor and operating system<BR><LI><STRONG>OS:</STRONG> Windows 10 64 bit<BR><LI><STRONG>Processor:</STRONG> Intel i5 3.4Ghz<BR><LI><STRONG>Memory:</STRONG> 16 GB RAM<BR><LI><STRONG>Graphics:</STRONG> Geforce GTX 1060<BR><LI><STRONG>DirectX:</STRONG> Version 11<BR><LI><STRONG>Network:</STRONG> Broadband Internet connection<BR><LI><STRONG>Storage:</STRONG> 10 GB available space</LI></UL></UL></DIV><DIV style="CLEAR: both"></DIV></DIV></DIV>',genre:"Action","genre 2":"Indie","genre 3":"Massively Multiplayer","genre 4":"Early Access","genre 5":null,c:"https://steamcdn-a.akamaihd.net/steam/apps/256749060/movie.184x123.jpg?t=1558318879","c 2":"https://steamcdn-a.akamaihd.net/steam/apps/256739858/movie.184x123.jpg?t=1558317775","c 3":"https://steamcdn-a.akamaihd.net/steam/apps/956580/ss_9576784e5d600bbab63814f89065131de17ca8c9.116x65.jpg?t=1559189655","c 4":"https://steamcdn-a.akamaihd.net/steam/apps/956580/ss_bacb2d36c2a025de2702e571ed2d37a18bf6d4f1.116x65.jpg?t=1559189655","c 5":"https://steamcdn-a.akamaihd.net/steam/apps/956580/ss_d38b1568391705f2d744b3ccd14a48c0eb6d061e.116x65.jpg?t=1559189655","c 6":"https://steamcdn-a.akam